import React from 'react'

function TaskItem(props) {
  return (
    <div>
        <h3>{props.task.title}</h3>
        <p>{props.task.body}</p>
        <button>Edit</button>
        <button>Delete</button>
    </div>
  )
}

export default TaskItem
